  summary: "\nTooltip provider plugin for conflicts, keyed by appointment id&apos;s (masters, or explicit conflicts)\n"
  remarks: "\nThe provider supports three kinds of keys: conflict_id, which means &apos;I know that that appointment is in\nconflict with whatever I&apos;m showing a tooltip for&apos;; conflictMaster_id, which means &apos;please find appointments\nthat conflict with this one&apos;; and cliflictStartDate/conflictEndDate, where you simply search for conflicts in a \ngiven interval.\n<p></p>\nUse conflict_id if you already know the conflicts, that will save time. \n<p></p>\nUse conflictMaster_id if you have no idea about the conflicts but want to show a conflict tooltip anyway. The conflict detector\nis executed using data from the indicated appointment. You can override the start and end times using the keys\nconflictStartDate and conflictEndDate, if they have changed from the data in the database.\n<p></p>\nUse conflictStartDate and conflictEndDate (both, not just one of them) to search for conflicts in the given\ntime interval. Any appointment that overlaps will be deemed a conflict.\n<pre><code>conflict_id=123&amp;conflictMaster_id=200&amp;conflict_id=456</code></pre>\nThis would mean &apos;I know that 123 and 456 are conflicts, and please find any additional conflicts with 200. Master\nconflicts are resolved first, then explicit ones. All searching looks at the diary of the current associate only.\n<p></p>\nThis provider uses the <xref href=\"SuperOffice.CRM.Tooltips.AppointmentTooltipPlugin\" data-throw-if-not-resolved=\"false\"></xref> to fetch the actual tooltips,\nand shows up to 4 of them, with an overflow indicator if there are more.\n"
  syntax:
    content: >-
      [TooltipPlugin("SuperOffice:conflicts", new string[]{"conflict_id", "conflictMaster_id", "conflictStartDate", "conflictEndDate"})]

      public class ConflictTooltipPlugin : TooltipPluginBase, ITooltipProviderPlugin, IPlugin
    content.vb: >-
      <TooltipPlugin("SuperOffice:conflicts", New String() {"conflict_id", "conflictMaster_id", "conflictStartDate", "conflictEndDate"})>

      Public Class ConflictTooltipPlugin
          Inherits TooltipPluginBase
          Implements ITooltipProviderPlugin, IPlugin
